import logo from './logo.svg';
import './App.css';
import React from "react";

class App extends React.Component {
  constructor() {
    this.state = {
      result: []
    }
  }

  render() {
    fetch("http://localhost:8080/coinexchange")
    .then(
        (res) => {
          this.setState({
            result: res
          });
        }
      )
    return (
      <div>
        { this.state.result }
      </div>
    );
  }
}


export default App;
